  false,\n\t\"url\": null,\n\t\"notes\": \"Arctic fox were introduced for the purpose
  of fur farming by the Russians at the turn of the century on the majority of the
  islands in the Aleutian chain. These introductions significantly disrupted a relatively
  simple ecosystem. The U.S. Fish and Wildlife Service conducted an eradication program
  on Amata Island during 1983-1984. Methods and results are discussed in this report.\",\n\t\"license_title\":
